import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.containerCenter}>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderBottom, styles.borderRight]}>
          <Text>1</Text>
        </View>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderBottom]}>
          <Text>2</Text>
        </View>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderBottom]}>
          <Text>3</Text>
        </View>
      </View>
      <View style={styles.containerCenter}>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderTop, styles.borderBottom, styles.borderRight, styles.borderLeft]}>
          <Text>4</Text>
        </View>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderTop]}>
          <Text>5</Text>
        </View>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderTop]}>
          <Text>6</Text>
        </View>
      </View>
      <View style={styles.containerCenter}>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderTop]}>
          <Text>7</Text>
        </View>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderTop]}>
          <Text>8</Text>
        </View>
        <View style={[styles.box, styles.bgPrimary, styles.borderColor, styles.borderTop]}>
          <Text>9</Text>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  containerCenter: {
    flexDirection: 'row',

  },
  box: {
    height: 70,
    width: 70,
  },
  bgPrimary: {
    backgroundColor: '#007bff'
  },
  borderTop: {
    borderTopWidth: 1,
  },
  borderBottom: {
    borderBottomWidth: 1,
  },
  borderLeft: {
    borderLeftWidth: 1,
  },
  borderRight: {
    borderRightColor: 1,
  },
  borderColor: {
    borderTopColor: '#dc3545',
  }
});
